import { Component } from "react";

const styles = {
    layout: {
        backgroundColor: '#fff',
        color: '#0A28E',
        alignItems: 'center',
        display: 'flex',
        flexDirection: 'column',
    },
    container: {
        width: '1200px'
    }
}

class Layout extends Component{
    render() {
        return (
            <div style={styles.layout}>
                <div style={styles.container}>
                    {this.props.children}
                    lala
                </div>
            </div>
        )
    }
}
export default Layout
